import React, { useState, useEffect, useMemo } from 'react';
import { Link, NavLink, useNavigate } from 'react-router-dom';
import { jwtDecode } from 'jwt-decode';
import axios from '../utils/axios';
import { useTheme } from '../context/ThemeContext';
import { useAuth } from '../context/AuthContext';

const DEFAULT_FEATURES = {
  Transactions: true,
  Budgets: true,
  Reports: true,
  Savings: true,
  Goals: true,
};

const Navbar = () => {
  const { token, logout } = useAuth();
  const navigate = useNavigate();
  const { theme, toggleTheme } = useTheme();
  const [featureFlags, setFeatureFlags] = useState(DEFAULT_FEATURES);
  const [isOpen, setIsOpen] = useState(false);

  const userRole = useMemo(() => {
    if (!token) return 'user';
    try {
      return jwtDecode(token).user.role || 'user';
    } catch (error) {
      console.error('Invalid token:', error);
      return 'user';
    }
  }, [token]);

  useEffect(() => {
    const fetchFeatureFlags = async () => {
      if (!token) return;
      try {
        const res = await axios.get('/admin/features');
        const flags = res.data.reduce((acc, flag) => {
          const name = flag.name || flag.feature;
          acc[name] = flag.isEnabled !== undefined ? flag.isEnabled : flag.enabled;
          return acc;
        }, {});
        setFeatureFlags(flags);
      } catch (err) {
        console.warn('Could not fetch feature flags, falling back to defaults.');
        setFeatureFlags(DEFAULT_FEATURES);
      }
    };

    fetchFeatureFlags();
  }, [token]);

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  const navLinkClasses = ({ isActive }) =>
    `block sm:inline-flex items-center px-3 py-2 rounded-md text-sm font-medium min-h-[44px] transition-colors ` +
    (isActive
      ? 'bg-teal-500 text-white'
      : 'text-gray-700 dark:text-gray-300 hover:bg-gray-200 dark:hover:bg-gray-700');

  const navItems = [
    { to: '/dashboard', label: 'Dashboard', flag: true },
    { to: '/transactions', label: 'Transactions', flag: featureFlags.Transactions },
    { to: '/budgets', label: 'Budgets', flag: featureFlags.Budgets },
    { to: '/reports', label: 'Reports', flag: featureFlags.Reports },
    { to: '/savings', label: 'Savings', flag: featureFlags.Savings },
    { to: '/goals', label: 'Goals', flag: featureFlags.Goals },
    { to: '/contact-us', label: 'Contact Us', flag: true },
    { to: '/admin', label: 'Admin', flag: userRole === 'admin' },
  ];

  return (
    <nav className="bg-white/80 dark:bg-gray-800/80 backdrop-blur-md shadow-md fixed top-0 left-0 right-0 z-50" style={{ '--nav-height': '64px' }}>
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex items-center justify-between h-16">
          <div className="flex items-center">
            <Link to="/dashboard" className="text-2xl font-bold text-teal-600 dark:text-teal-400">
              Finaurial
            </Link>
          </div>
          <div className="hidden sm:ml-6 sm:flex sm:items-center sm:space-x-1">
            {navItems.map(item => item.flag && (
              <NavLink key={item.to} to={item.to} className={navLinkClasses} aria-current={item.to === window.location.pathname ? 'page' : undefined}>{item.label}</NavLink>
            ))}
          </div>
          <div className="flex items-center">
            <button
              onClick={toggleTheme}
              className="p-2 rounded-md text-gray-600 dark:text-gray-300 hover:bg-gray-200 dark:hover:bg-gray-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-teal-500"
              aria-label={theme === 'light' ? 'Switch to dark mode' : 'Switch to light mode'}
            >
              {theme === 'light' ? 'üåô' : '‚òÄÔ∏è'}
            </button>
            <button
              onClick={handleLogout}
              className="hidden sm:block bg-red-500 text-white px-4 py-2 rounded-md ml-4 hover:bg-red-600 min-h-[44px]"
            >
              Logout
            </button>
            <div className="sm:hidden ml-2">
              <button
                onClick={() => setIsOpen(!isOpen)}
                type="button"
                className="inline-flex items-center justify-center p-2 rounded-md text-gray-500 hover:bg-gray-700 focus:outline-none"
                aria-controls="mobile-menu"
                aria-expanded={isOpen}
              >
                <span className="sr-only">Open main menu</span>
                {isOpen ? (
                  <svg className="block h-6 w-6" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M6 18L18 6M6 6l12 12" /></svg>
                ) : (
                  <svg className="block h-6 w-6" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M4 6h16M4 12h16M4 18h16" /></svg>
                )}
              </button>
            </div>
          </div>
        </div>
      </div>

      {isOpen && (
        <div className="sm:hidden bg-white dark:bg-gray-800" id="mobile-menu">
          <div className="px-2 pt-2 pb-3 space-y-1">
            {navItems.map(item => item.flag && (
              <NavLink key={item.to} to={item.to} className={navLinkClasses} onClick={() => setIsOpen(false)} aria-current={item.to === window.location.pathname ? 'page' : undefined}>{item.label}</NavLink>
            ))}
            <button
              onClick={() => { handleLogout(); setIsOpen(false); }}
              className="block w-full text-left bg-red-500 text-white px-3 py-2 rounded-md mt-2 hover:bg-red-600 min-h-[44px]"
            >
              Logout
            </button>
          </div>
        </div>
      )}
    </nav>
  );
};

export default Navbar;
